import {KnowledgeType} from "../../../../utils/types/types";
import {KnowledgeItem} from "./KnowledgeItem";

type Props = {
    cards: KnowledgeType[];
}

export const KnowledgeContent: React.FC<Props> = ({cards}) => {
    return (
        <>
            {cards.map((item, idx) =>
                <KnowledgeItem key={idx} card={item}/>
            )}
        </>
    );
};
